import NavIcon from './Icons/NavIcon.jsx';
import TimeBox from './TimeBox.jsx';
import { IconSettings } from '@tabler/icons-react';
import { faLinkedin, faGithub } from '@fortawesome/free-brands-svg-icons';
import { faAddressBook } from '@fortawesome/free-regular-svg-icons'

function NavBar() {
    return (
        <div class="flex flex-col items-start">
            <div class="flex flex-row justify-between items-center bg-white border-b-2 border-black w-full p-2">
                <div class="flex flex-row justify-center items-center pl-3">
                    <div class="border-r-2 pr-5 border-black">
                        <IconSettings class="hover:rotate-90 hover:scale-125 transition duration-500 cursor-pointer" color={"black"} size={32}/>
                    </div>
                    <div class="flex flex-row gap-4 pl-5">
                        <NavIcon icon={faLinkedin} name="LinkedIn" link="https://www.linkedin.com/in/nicholasangelici/"/>
                        <NavIcon icon={faGithub} name="Github" link="https://github.com/NickCoding22"/>
                        <NavIcon icon={faAddressBook} name="Resume" link="https://github.com/NickCoding22"/>
                    </div>
                </div>
                <TimeBox />
            </div>
        </div>
    )
}

export default NavBar;
